// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./MyToken.sol";
import "./IERC20Interface.sol";

contract OrderBooks {
    enum OrderType { Buy, Sell }

    struct Order {
        uint id;
        address trader;
        OrderType orderType;
        address inputToken;
        uint inputAmount;
        address outputToken;
        uint outputAmount;
        bool isFulfilled;
        bool isCanceled;
    }

    MyToken private myToken;
    TokenA private tokenA;
    TokenB private tokenB;

    address[] public tokens;

    constructor(address _myTokenAddress, address _tokenAAddress, address _tokenBAddress) {
        myToken = MyToken(_myTokenAddress);
        tokenA = TokenA(_tokenAAddress);
        tokenB = TokenB(_tokenBAddress);

        // Initialize tokens array
        tokens.push(_myTokenAddress);
        tokens.push(_tokenAAddress);
        tokens.push(_tokenBAddress);
        orderCounter = 0;
    }

    mapping(address => mapping(address => Order[])) public buyOrders;
    mapping(address => mapping(address => Order[])) public sellOrders;

    uint public orderCounter;

    event OrderCreated(uint id, address indexed trader, OrderType orderType, address indexed inputToken, uint inputAmount, address indexed outputToken, uint outputAmount);
    event OrderFulfilled(uint id, address indexed trader, OrderType orderType, address indexed inputToken, uint inputAmount, address indexed outputToken, uint outputAmount);
    event OrderCanceled(uint id, address indexed trader, OrderType orderType);

    // Function to create and match a buy order
    function createAndMatchBuyOrder(
        address inputToken, 
        uint inputAmount, 
        address outputToken, 
        uint outputAmount
    ) external returns (Order memory) {
        orderCounter++;

        // Create a new buy order
        Order memory newOrder = Order({
            id: orderCounter,
            trader: msg.sender,
            orderType: OrderType.Buy,
            inputToken: inputToken,
            inputAmount: inputAmount,
            outputToken: outputToken,
            outputAmount: outputAmount,
            isFulfilled: false,
            isCanceled: false
        });

        // Keep track of the amounts to be matched
        uint tempInputAmount = newOrder.inputAmount;
        uint tempOutputAmount = newOrder.outputAmount;

        // Retrieve sell orders for matching
        Order[] storage sells = sellOrders[outputToken][inputToken];

        for (uint j = 0; j < sells.length; j++) {
            Order storage sellOrder = sells[j];

            // Skip already fulfilled or canceled sell orders
            if (sellOrder.isFulfilled || sellOrder.isCanceled) continue;

            uint amountToMatch = min(tempOutputAmount, sellOrder.outputAmount);
            uint inputAmountNeeded = (amountToMatch * sellOrder.inputAmount) / sellOrder.outputAmount;

            if (inputAmountNeeded <= tempInputAmount) {
                // Transfer input tokens based on their type
                if (inputToken == address(myToken)) {
                    require(MyToken(inputToken).transferFrom(newOrder.trader, sellOrder.trader, inputAmountNeeded), "Transfer of input tokens failed");
                } else if (inputToken == address(tokenA)) {
                    require(TokenA(inputToken).transferFrom(newOrder.trader, sellOrder.trader, inputAmountNeeded), "Transfer of input tokens failed");
                } else if (inputToken == address(tokenB)) {
                    require(TokenB(inputToken).transferFrom(newOrder.trader, sellOrder.trader, inputAmountNeeded), "Transfer of input tokens failed");
                } else {
                    require(IERC20(inputToken).transferFrom(newOrder.trader, sellOrder.trader, inputAmountNeeded), "Transfer of output tokens failed");
                }

                if (outputToken == address(myToken)) {
                    require(MyToken(outputToken).transferFrom(sellOrder.trader, newOrder.trader, amountToMatch), "Transfer of input tokens failed");
                } else if (outputToken == address(tokenA)) {
                    require(TokenA(outputToken).transferFrom(sellOrder.trader, newOrder.trader, amountToMatch), "Transfer of input tokens failed");
                } else if (outputToken == address(tokenB)) {
                    require(TokenB(outputToken).transferFrom(sellOrder.trader, newOrder.trader, amountToMatch), "Transfer of input tokens failed");
                } else {
                    require(IERC20(outputToken).transferFrom(sellOrder.trader, newOrder.trader, amountToMatch), "Transfer of output tokens failed");
                }

                // Transfer output tokens from the seller to the buyer
                //require(IERC20Interface(sellOrder.outputToken).transferFrom(sellOrder.trader, newOrder.trader, amountToMatch), "Transfer of output tokens failed");

                // Update amounts accordingly
                tempInputAmount -= inputAmountNeeded;
                tempOutputAmount -= amountToMatch;
                sellOrder.inputAmount -= inputAmountNeeded;
                sellOrder.outputAmount -= amountToMatch;

                // Mark sell order as fulfilled if it has been completely matched
                if (sellOrder.outputAmount == 0) {
                    sellOrder.isFulfilled = true;
                }
                // Mark new order as fulfilled if all output has been matched
                if (tempOutputAmount == 0) {
                    newOrder.isFulfilled = true;
                    break;
                }

                // Emit events for successful matching
                emit OrderFulfilled(newOrder.id, newOrder.trader, OrderType.Buy, newOrder.inputToken, inputAmountNeeded, newOrder.outputToken, amountToMatch);
                emit OrderFulfilled(sellOrder.id, sellOrder.trader, OrderType.Sell, sellOrder.inputToken, inputAmountNeeded, sellOrder.outputToken, amountToMatch);
            }
        }

        // If there's any output amount left unmatched, store the new order
        if (tempOutputAmount > 0) {
            buyOrders[inputToken][outputToken].push(newOrder);
        } else {
            emit OrderCreated(newOrder.id, msg.sender, OrderType.Buy, inputToken, newOrder.inputAmount, outputToken, outputAmount);
        }

        return newOrder;
    }


    function createAndMatchSellOrder(address inputToken, uint inputAmount, address outputToken, uint outputAmount) external returns (Order memory) {
        orderCounter++;
        Order memory newOrder = Order({
            id: orderCounter,
            trader: msg.sender,
            orderType: OrderType.Sell,
            inputToken: inputToken,
            inputAmount: inputAmount,
            outputToken: outputToken,
            outputAmount: outputAmount,
            isFulfilled: false,
            isCanceled: false
        });

        uint tempInputAmount = newOrder.inputAmount;
        uint tempOutputAmount = newOrder.outputAmount;

        Order[] storage buys = buyOrders[inputToken][outputToken];
        for (uint i = 0; i < buys.length; i++) {
            Order storage buyOrder = buys[i];
            if (buyOrder.isFulfilled || buyOrder.isCanceled) continue;

            uint amountToMatch = min(tempOutputAmount, buyOrder.outputAmount);
            uint inputAmountNeeded = (amountToMatch * buyOrder.inputAmount) / buyOrder.outputAmount;

            if (inputAmountNeeded <= tempInputAmount) {
                // Transfer output tokens from seller to buyer
                // if (outputToken == address(myToken)) {
                //     require(myToken.transferFrom(newOrder.trader, buyOrder.trader, amountToMatch), "Transfer of output tokens failed");
                // } else if (outputToken == address(tokenA)) {
                //     require(tokenA.transferFrom(newOrder.trader, buyOrder.trader, amountToMatch), "Transfer of output tokens failed");
                // } else if (outputToken == address(tokenB)) {
                //     require(tokenB.transferFrom(newOrder.trader, buyOrder.trader, amountToMatch), "Transfer of output tokens failed");
                // } else {
                //     require(IERC20(outputToken).transferFrom(newOrder.trader, buyOrder.trader, amountToMatch), "Transfer of output tokens failed");
                // }
                IERC20(outputToken).transferFrom(newOrder.trader, buyOrder.trader, amountToMatch);
                IERC20(inputToken).transferFrom(buyOrder.trader, newOrder.trader, inputAmountNeeded);

                // Transfer input tokens from buyer to seller
                // if (inputToken == address(myToken)) {
                //     require(myToken.transferFrom(buyOrder.trader, newOrder.trader, inputAmountNeeded), "Transfer of input tokens failed");
                // } else if (inputToken == address(tokenA)) {
                //     require(tokenA.transferFrom(buyOrder.trader, newOrder.trader, inputAmountNeeded), "Transfer of input tokens failed");
                // } else if (inputToken == address(tokenB)) {
                //     require(tokenB.transferFrom(buyOrder.trader, newOrder.trader, inputAmountNeeded), "Transfer of input tokens failed");
                // } else {
                //     require(IERC20(inputToken).transferFrom(buyOrder.trader, newOrder.trader, inputAmountNeeded), "Transfer of output tokens failed");
                // }

                // Update amounts
                tempInputAmount -= inputAmountNeeded;
                tempOutputAmount -= amountToMatch;
                buyOrder.inputAmount -= inputAmountNeeded;
                buyOrder.outputAmount -= amountToMatch;

                if (buyOrder.outputAmount == 0) {
                    buyOrder.isFulfilled = true;
                }
                if (tempOutputAmount == 0) {
                    newOrder.isFulfilled = true;
                    break;
                }

                emit OrderFulfilled(newOrder.id, newOrder.trader, OrderType.Sell, newOrder.inputToken, inputAmountNeeded, newOrder.outputToken, amountToMatch);
                emit OrderFulfilled(buyOrder.id, buyOrder.trader, OrderType.Buy, buyOrder.inputToken, inputAmountNeeded, buyOrder.outputToken, amountToMatch);
            }
        }

        if (tempOutputAmount > 0) {
            sellOrders[inputToken][outputToken].push(newOrder);
        } else {
            emit OrderCreated(newOrder.id, msg.sender, OrderType.Sell, inputToken, inputAmount, outputToken, outputAmount);
        }

        return newOrder;
    }




    // Utility function to find the minimum of two values
    function min(uint a, uint b) internal pure returns (uint) {
        return a < b ? a : b;
    }

    // Debugging event
    event Debug(string message, uint orderId, address trader, uint amount1, address trader2, uint amount2);


    function cancelBuyOrder(uint orderId, address inputToken, address outputToken) external {
        Order[] storage orders = buyOrders[inputToken][outputToken];
        for (uint i = 0; i < orders.length; i++) {
            if (orders[i].id == orderId && orders[i].trader == msg.sender) {
                orders[i].isCanceled = true;
                emit OrderCanceled(orderId, msg.sender, OrderType.Buy);
                return;
            }
        }
        revert("Order not found or not owned by caller");
    }

    function cancelSellOrder(uint orderId, address inputToken, address outputToken) external {
        Order[] storage orders = sellOrders[inputToken][outputToken];
        for (uint i = 0; i < orders.length; i++) {
            if (orders[i].id == orderId && orders[i].trader == msg.sender) {
                orders[i].isCanceled = true;
                emit OrderCanceled(orderId, msg.sender, OrderType.Sell);
                return;
            }
        }
        revert("Order not found or not owned by caller");
    }

    function getBuyOrders(address inputToken, address outputToken) external view returns (Order[] memory) {
        return buyOrders[inputToken][outputToken];
    }

    function getSellOrders(address inputToken, address outputToken) external view returns (Order[] memory) {
        return sellOrders[inputToken][outputToken];
    }





    function createMarketBuyOrder(address inputToken, uint inputAmount, address outputToken) external returns (Order memory) {
        orderCounter++;
        Order memory newOrder = Order({
            id: orderCounter,
            trader: msg.sender,
            orderType: OrderType.Buy,
            inputToken: inputToken,
            inputAmount: inputAmount,
            outputToken: outputToken,
            outputAmount: 0, // Not needed for market orders
            isFulfilled: false,
            isCanceled: false
        });

        uint remainingInputAmount = inputAmount;
        uint totalOutputMatched = 0;

        Order[] storage sells = sellOrders[outputToken][inputToken];
        for (uint j = 0; j < sells.length; j++) {
            Order storage sellOrder = sells[j];
            if (sellOrder.isFulfilled || sellOrder.isCanceled) continue;

            uint amountToMatch = min(remainingInputAmount, sellOrder.outputAmount);
            uint inputAmountNeeded = (amountToMatch * sellOrder.inputAmount) / sellOrder.outputAmount;

            if (inputAmountNeeded <= remainingInputAmount) {
                // Transfer input tokens from seller to buyer
                if (sellOrder.inputToken == address(myToken)) {
                    require(myToken.transferFrom(sellOrder.trader, msg.sender, inputAmountNeeded), "Token transfer from seller to buyer failed");
                } else if (sellOrder.inputToken == address(tokenA)) {
                    require(tokenA.transferFrom(sellOrder.trader, msg.sender, inputAmountNeeded), "Token transfer from seller to buyer failed");
                } else if (sellOrder.inputToken == address(tokenB)) {
                    require(tokenB.transferFrom(sellOrder.trader, msg.sender, inputAmountNeeded), "Token transfer from seller to buyer failed");
                } else {
                    revert("Unsupported input token type");
                }

                // Transfer output tokens from buyer to seller
                if (sellOrder.outputToken == address(myToken)) {
                    require(myToken.transferFrom(msg.sender, sellOrder.trader, amountToMatch), "Token transfer from buyer to seller failed");
                } else if (sellOrder.outputToken == address(tokenA)) {
                    require(tokenA.transferFrom(msg.sender, sellOrder.trader, amountToMatch), "Token transfer from buyer to seller failed");
                } else if (sellOrder.outputToken == address(tokenB)) {
                    require(tokenB.transferFrom(msg.sender, sellOrder.trader, amountToMatch), "Token transfer from buyer to seller failed");
                } else {
                    revert("Unsupported output token type");
                }

                remainingInputAmount -= inputAmountNeeded;
                totalOutputMatched += amountToMatch;
                sellOrder.outputAmount -= amountToMatch;

                if (sellOrder.outputAmount == 0) {
                    sellOrder.isFulfilled = true;
                }

                emit OrderFulfilled(
                    newOrder.id,
                    newOrder.trader,
                    OrderType.Buy,
                    newOrder.inputToken,
                    inputAmountNeeded,
                    newOrder.outputToken,
                    amountToMatch
                );

                if (remainingInputAmount == 0) {
                    newOrder.isFulfilled = true;
                    break;
                }
            }
        }

        if (remainingInputAmount > 0) {
            buyOrders[inputToken][outputToken].push(newOrder);
        } else {
            emit OrderCreated(
                newOrder.id,
                msg.sender,
                OrderType.Buy,
                inputToken,
                inputAmount,
                outputToken,
                totalOutputMatched
            );
        }

        return newOrder;
    }

    function createMarketSellOrder(address outputToken, uint outputAmount, address inputToken) external returns (Order memory) {
        orderCounter++;
        Order memory newOrder = Order({
            id: orderCounter,
            trader: msg.sender,
            orderType: OrderType.Sell,
            inputToken: inputToken,
            inputAmount: 0, // Not needed for market orders
            outputToken: outputToken,
            outputAmount: outputAmount,
            isFulfilled: false,
            isCanceled: false
        });

        uint remainingOutputAmount = outputAmount;
        uint totalInputMatched = 0;

        Order[] storage buys = buyOrders[inputToken][outputToken];
        for (uint i = 0; i < buys.length; i++) {
            Order storage buyOrder = buys[i];
            if (buyOrder.isFulfilled || buyOrder.isCanceled) continue;

            uint amountToMatch = min(remainingOutputAmount, buyOrder.outputAmount);
            uint inputAmountNeeded = (amountToMatch * buyOrder.inputAmount) / buyOrder.outputAmount;

            if (amountToMatch <= remainingOutputAmount) {
                // Transfer input tokens from seller to buyer
                if (buyOrder.inputToken == address(myToken)) {
                    require(myToken.transferFrom(buyOrder.trader, msg.sender, inputAmountNeeded), "Token transfer from buyer to seller failed");
                } else if (buyOrder.inputToken == address(tokenA)) {
                    require(tokenA.transferFrom(buyOrder.trader, msg.sender, inputAmountNeeded), "Token transfer from buyer to seller failed");
                } else if (buyOrder.inputToken == address(tokenB)) {
                    require(tokenB.transferFrom(buyOrder.trader, msg.sender, inputAmountNeeded), "Token transfer from buyer to seller failed");
                } else {
                    revert("Unsupported input token type");
                }

                // Transfer output tokens from buyer to seller
                if (buyOrder.outputToken == address(myToken)) {
                    require(myToken.transferFrom(msg.sender, buyOrder.trader, amountToMatch), "Token transfer from seller to buyer failed");
                } else if (buyOrder.outputToken == address(tokenA)) {
                    require(tokenA.transferFrom(msg.sender, buyOrder.trader, amountToMatch), "Token transfer from seller to buyer failed");
                } else if (buyOrder.outputToken == address(tokenB)) {
                    require(tokenB.transferFrom(msg.sender, buyOrder.trader, amountToMatch), "Token transfer from seller to buyer failed");
                } else {
                    revert("Unsupported output token type");
                }

                remainingOutputAmount -= amountToMatch;
                totalInputMatched += inputAmountNeeded;
                buyOrder.outputAmount -= amountToMatch;

                if (buyOrder.outputAmount == 0) {
                    buyOrder.isFulfilled = true;
                }

                emit OrderFulfilled(
                    newOrder.id,
                    newOrder.trader,
                    OrderType.Sell,
                    newOrder.inputToken,
                    inputAmountNeeded,
                    newOrder.outputToken,
                    amountToMatch
                );

                if (remainingOutputAmount == 0) {
                    newOrder.isFulfilled = true;
                    break;
                }
            }
        }

        if (remainingOutputAmount > 0) {
            sellOrders[inputToken][outputToken].push(newOrder);
        } else {
            emit OrderCreated(
                newOrder.id,
                msg.sender,
                OrderType.Sell,
                inputToken,
                totalInputMatched,
                outputToken,
                outputAmount
            );
        }

        return newOrder;
    }

}

